import './Cadastrar.css';



export default function Cadastrar() {
    return(
        <div className="cadastro-conteiner">
            <h2>
                <h1>Cadastro</h1>
            </h2>
            <form >
                <h1>E-mail</h1>
                <input type="email" ></input>
            </form>


        </div>
    )
};
